import React from "react";
import {Slide} from 'react-slideshow-image'
import 'react-slideshow-image/dist/styles.css'
const images = [
  'https://www.flickr.com/photos/hph46/50433098296/in/explore-2020-10-08/',
  'https://images.unsplash.com/photo-1478562672393-2412e5b9d634?ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60'

];

function Home() {
  
  return (
    <div>
      <h1>Home Page</h1>
      <Slide duration='3000' transitionDuration='1000' arrows={false}>         
            <div style={{'backgroundImage': `url(${images[0]})`,'background-size':'cover', 'height':"500px"}}/>
            <div style={{'backgroundImage': `url(${images[1]})`, 'background-size':'cover','height':"500px"}}/>
            
        </Slide>
    </div>
  );
}

export default Home;
